    //提交申请
    StockSystemMarketingApplyComponent.prototype.commit = function () {
        var _this = this;
        // if (this.tableValueList.length == 0) {
        //     this.msgs = [];
        //     this.msgs.push({ severity: 'error', summary: '提示', detail: "请录入账户信息!" });
        //     return;
        // }
        if (this.cooperatorTableValueList.length == 0) {
            this.msgs = [];
            this.msgs.push({ severity: 'error', summary: '提示', detail: "请录入协储员信息!" });
            return;
        }
        var num = 0;
        var hasdivideLoseFlag = false; // 无分成失效后协储员
        this.cooperatorTableValueList.forEach(function (element) {
            num = num + parseFloat(element.dividerate);
            if (element.divideLoseFlag == '0') {
                hasdivideLoseFlag = true; // 有分成失效后协储员
            }
        });
        if (num < 100) {
            this.msgs = [];
            this.msgs = [{ severity: 'error', summary: '提示', detail: '各协储员号的分成比例之和小于100%' }];
            return;
        }
        if (!hasdivideLoseFlag) {
            this.msgs = [];
            this.msgs = [{ severity: 'error', summary: '提示', detail: '协储员列表中无分成失效后协储员!' }];
            return;
        }
        // 查询协儲员信息
        var param2 = {
            seqno: this.shareholdingNo
        };
        var s1 = '';
        var s2 = '';
        var s3 = '';
        var s4 = '';
        this.s5 = '';
        this.s6 = '';
        this.httpService.queryAssitIdList(param2).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                var aa = [], bb = [];
                aa = data.infoList == null ? [] : data.infoList;
                bb = data.oldInfoList == null ? [] : data.oldInfoList;
                if (aa.length > 0) {
                    aa.forEach(function (item) {
                        s1 += item.assiterId + ',';
                        s2 += item.assitMgr + ',';
                    });
                }
                if (bb.length > 0) {
                    bb.forEach(function (item) {
                        s4 += item.oldAssitMgr + ',';
                    });
                }
                s3 = data.openOrg;
                _this.s5 = data.workFlowType;
                _this.s6 = data.postOrg;
                _this.confirmationService.confirm({
                    message: '确认要提交股份制编号为' + _this.shareholdingNo + '的申请吗?',
                    header: '提交审核',
                    accept: function () {
                        var s = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                        if (s.extParam.specifyNextOpers) {
                            delete s.extParam.specifyNextOpers;
                            var commonHeader = s;
                            _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
                        }
                        _this.waitSelUserList = _this.commfunc.query('GFZFCLC', { assiter: s1, assiterMgr: s2, openOrg: s3, oldAssiterMgr: s4, workFlowType: _this.s5, postOrg: _this.s6 });
                        if (!_this.waitSelUserList.erro) {
                            _this.outVal = _this.waitSelUserList.waitSelUserList;
                            var chooseThis = _this.waitSelUserList.display;
                            var commonHeader = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                            var a2 = commonHeader.extParam.specifyNextOpers;
                            if (chooseThis == true && (a2 == undefined || a2 == '' || a2 == null)) {
                                _this.dealPerShow = true;
                            }
                            else {
                                _this.subAudit();
                            }
                        }
                        else {
                            _this.msgs = [];
                            _this.msgs.push({ severity: 'error', summary: '提示', detail: _this.waitSelUserList.erro });
                        }
                    }
                });
            }
            else {
                _this.msgs = [];
                _this.msgs = [{ severity: 'error', summary: '提示', detail: data.returnCode.message }];
            }
        }, function (err) {
            _this.msgs = [];
            _this.msgs = [{ severity: 'error', summary: '提示', detail: '调用失败！' }];
        });
    };
