    // 提交前判断是否录入协储员
    StockSystemMarketingUnauditedQueryComponent.prototype.subApplyPre = function (col) {
        var _this = this;
        var param = {};
        param = {
            operationType: 1,
            seqno: col.seqno,
            pageNum: 1,
            pageSize: 20
        };
        this.httpService.queryJointStocksInfo(param).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                _this.cooperatorTableValueList = data.assitList == null ? [] : data.assitList;
                if (_this.cooperatorTableValueList.length == 0) {
                    _this.msgs = [];
                    _this.msgs.push({ severity: 'error', summary: '提示', detail: "请录入协储员信息!" });
                    return;
                }
                var num_1 = 0;
                var hasdivideLoseFlag_1 = false; // 无分成失效后协储员
                _this.cooperatorTableValueList.forEach(function (element) {
                    num_1 = num_1 + parseFloat(element.dividerate);
                    if (element.divideLoseFlag == '0') {
                        hasdivideLoseFlag_1 = true; // 有分成失效后协储员
                    }
                });
                if (num_1 < 100) {
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '提示', detail: '各协储员号的分成比例之和小于100%' }];
                    return;
                }
                if (!hasdivideLoseFlag_1) {
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '提示', detail: '协储员列表中无分成失效后协储员!' }];
                    return;
                }
                _this.subApply(col);
            }
            else {
                _this.msgs = [];
                _this.msgs = [{ severity: 'error', summary: '提示', detail: data.returnCode.message }];
            }
        }, function (err) {
            _this.msgs = [];
            _this.msgs = [{ severity: 'error', summary: '提示', detail: '调用失败！' }];
        });
    };
