    // 添入列表-账户
    StockSystemMarketingUnauditedQueryComponent.prototype.add = function () {
        var _this = this;
        // 如果客户号和开户机构为空
        if (this.queryBean.newCustomerNo == null || this.queryBean.newCustomerNo == undefined || this.queryBean.newCustomerNo == "" ||
            this.queryBean.newOpenInstitutionName == null || this.queryBean.newOpenInstitutionName == undefined || this.queryBean.newOpenInstitutionName == "") {
            this.msgs = [];
            this.msgs = [{ severity: 'erro', summary: '提示', detail: '客户号和开户机构不能为空！' }];
            return;
        }
        // 校验数据是否重复
        var bool = true;
        for (var i = 0; i < this.newUserTableValueList.length; i++) {
            if (this.newUserTableValueList[i].accountNo == this.queryBean.newUserNo) {
                bool = false;
                break;
            }
        }
        // 前端校验不存在、后台再次校验数据是否准确
        if (bool) {
            var param = {
                busType: this.queryBean.newBusinessType,
                seqno: this.windowShareholdingNo,
                accountNo: this.queryBean.newUserNo,
                custCode: this.queryBean.newCustomerNo //客户号
            };
            this.httpService.checkAccountInfo(param).subscribe(function (data) {
                if (data.returnCode.code == 'success') {
                    _this.newUserTableValueListAdd = [];
                    _this.newUserTableValueListAdd.push({
                        "busType": _this.queryBean.newBusinessType,
                        "accountNo": _this.queryBean.newUserNo,
                        "custCode": _this.queryBean.newCustomerNo,
                        "custName": _this.queryBean.newCustomerName,
                        "openBranch": _this.queryBean.newOpenInstitution,
                        "openBanchName": _this.queryBean.newOpenInstitutionName,
                        "oldDepInfo": _this.queryBean.newOldInto,
                        "kmh": _this.queryBean.newSubjectNo,
                        "bankCode": _this.queryBean.newBankCode
                    });
                    _this.newUserBtn();
                    // this.newUserReset();
                }
                else {
                    _this.emptyAccount();
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '提示', detail: data.returnCode.message }];
                }
            }, function (err) {
                _this.emptyAccount();
                _this.msgs = [];
                _this.msgs = [{ severity: 'error', summary: '提示', detail: '调用失败！' }];
            });
        }
        else {
            this.msgs = [];
            this.msgs = [{ severity: 'error', summary: '提示', detail: "列表中已经存在该条账号信息" }];
            this.newUserReset();
        }
    };
